import React from 'react';


const server_url = 'http://localhost:11037';

function DisplayMovie(props) {
  return (props.trigger) ? (
    <div className="rank-rows">
      <h1>{props.movie.rank}</h1>
      <img src={props.movie.poster} alt='movie' className='movie-image-2'></img>
      <h2>{props.movie.title}</h2>
      <h2>{props.movie.year}</h2>
      <p>{props.movie.review}</p>
      <button onClick={deleteMovieRequest}>Delete</button>
    </div>
  ) : ""
}

export default DisplayMovie;
